window.bookSummaryJSON = "<p><b>Quinn McNamara</b></p> <p>Blood. Death. War. A dynasty destroyed, leaving me as the ultimate prize.</p> <p>I'm an unmated Omega Wolf, a princess destined to rule. But the remaining Alpha Princes all want to claim me, their brutal methods terrifying and cruel.</p> <p>I’ve spent the last century running and hiding in places where no one would think to look. Only he found me: Prince Kieran, the most powerful shifter of them all.</p> <p>Our game of hide and seek has come to an end. It’s time for me to submit...or to die fighting.</p> <p><b>Kieran O’Callaghan</b></p> <p>My little trickster escaped me once. She indulged in a dangerous game of chase throughout the sectors, but I’ve finally found my prize.</p> <p>Poor little darling thought I valued chivalry and courting. I’m an Alpha Prince. I take what I want when I want it, how I want it. Her sweet blood beckons the predator within me to destroy all her dreams of a happily ever after.</p> <p>Let the princes enjoy their Royal V-Wars. As long as they bow to me as King of Blood Sector, I won’t intervene. Besides, I have a new pretty little Omega to tame. It’s time to put a crown on her and make her my queen.</p> <p><i>Blood Sector </i>is a standalone dark shifter romance with Omegaverse themes.</p>"; 
